INSERT INTO `competencies` (`id`, `description`, `meaning`) VALUES
(1, 'ADAPTABILIDAD', ' Mantener, efectividad cuando las situaciones cambian.'),
(2, 'APRENDIZAJE CONTUNUO', ' Tener habilidad intelectual para aprender nuevo conceptos y tareas.'),
(3, 'CONFIANZA', ' Inspirar credibilidad a través de acciones.'),
(4, 'ENERGIA', ' Mantener consistente un nivel de actividad y productividad en periodos largos.'),
(5, 'IMPACTO', ' Mantener una correcta imagen personal y profesional.'),
(6, 'INICIATIVA', ' Ser proactivo para alcanzar los objetivos.'),
(7, 'INTEGRIDAD', ' Mantener y promover las norma éticas organizacionales y sociales.'),
(8, 'TOLERANCIA AL ESTRÉS', ' Mantener un nivel de desempeño estable bajo presión'),
(9, 'CREATIVIDAD - INNOVACIÓN', ' Desafiar los paradigmas - identificar los supuestos y considerar maneras alternativas para estudiar o definir los problemas; pensar con amplitud de criterios.'),
(10, 'TENACIDAD', ' Mantenerse en una petición de acción hasta el logro del objetivo.'),
(11, 'ASESORIA', ' Orientar y facilitar el desarrollo de conocimientos y habilidades de otros.'),
(12, 'COMUNICACIÓN', ' Expresar ideas efectivamente en forma verbal y no verbal'),
(13, 'TRABAJO EN EQUIPO', ' Establecer buenas relaciones para colaborar con otros en el logro de un objetivo.'),
(14, 'LIDERZGO', ' Convencer y guiar los esfuerzos humanos hacia la obtención de objetivos'),
(15, 'COMPARTIENDO RESPONSABILIDAD', ' Proporcionar autoridad, nivel de decisiones y responsabilidad adecuada a cada colaborador.'),
(16, 'PARTICIPACIÓN EN REUNIONES', ' Usar estilos y métodos adecuados para guiar a los participante hacia el logro de los objetivos de la reunión.'),
(17, 'TOMA DE DECISIONES', ' Tomar acciones consistentes con hechos, restricciones y consecuencias. '),
(18, 'PLANEACIÓN Y ORGANIZACIÓN', ' Establece cursos de acción para poder cumplir un objetivo específico'),
(19, 'ORIENTACION AL CLIENTE', ' Satisfacerlas necesidades del cliente '),
(20, 'HABILIDAD DE PERSUASIÓN', ' Ser efectivo para conseguir la acepción de una idea, producto o servicio.');
